import './Styles.css';
import axios from "axios";

function App() {
  axios.get("http://localhost:8000/api/portfolio/");
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload. HI Mom
        </p>
        <a href="/Portfolio">Click here!</a>
      </header>
    </div>
  );
}

export default App;
